import React from 'react';
import { Link } from 'react-router-dom';


function NavBar() {
    const backStyle = {fontWeight: 600, width: '90px'}
  return (
    <>
    <Link to='/'>
      <span style={backStyle}>Back</span>
    </Link>

  <div id='nav'>
    <div class='desktop'>
      <a href='index.html'><span>Home</span></a>
      <a href='temp.html'><span>Projects</span></a>
      <a href='temp.html'><span>UI/UX</span></a>
      <a href='recipe_list.html'><span style='font-weight: 600;'>Recipes</span></a>
    </div>
    <div class='mobile'>
      <a href='index.html'><span>Home</span></a>
    </div>
  </div>
  </>

  );
}

export default NavBar;
